import { memo, VFC } from "react";
import { Route, Switch } from "react-router-dom";
import { Login } from "../components/pages/Login";

export const Router: VFC = memo(() => {
  return (
    <Switch>
      <Route exact path="/shiftwork_management">
        <Login />
      </Route>
      <Route></Route>
    </Switch>
  );
});
